// SPDX-License-Identifier: MIT

pragma solidity ^0.8.28;

error TransferFailed();

contract PayWithCrypto {
    mapping(string clientId => ClientData clientData) private clients;
    address private contractOwner;
    address payable public layer8WalletAddress;

    constructor(address payable _layer8WalletAddress) {
        layer8WalletAddress = _layer8WalletAddress;
        contractOwner = msg.sender;
    }

    struct ClientData {
        string clientId;
        int rate; // USDC on Polygon
        int totalTrafficInBytes;
        int unpaidAmount;
    }

    modifier onlyOwner() {
        require(msg.sender == contractOwner, "Only owner is allowed to execute this function");
        _;
    }

    function setLayer8WalletAddress(address payable _newLayer8WalletAddress) public onlyOwner {
        layer8WalletAddress = _newLayer8WalletAddress;
    }

    function addClient(string calldata clientId, int rate) public onlyOwner {
        ClientData storage clientData = clients[clientId];
        clientData.clientId = clientId;
        clientData.rate = rate;
    }

    function getClient(string calldata clientId) public view onlyOwner returns (ClientData memory) {
        return clients[clientId];
    }

    function getUnpaidAmount(string calldata clientId) public view returns (int) {
        ClientData storage clientData = clients[clientId];
        return clientData.unpaidAmount;
    }

    function addTrafficUsage(string calldata clientId, int trafficInBytes) public onlyOwner {
        ClientData storage clientData = clients[clientId];
        clientData.totalTrafficInBytes += trafficInBytes;
        clientData.unpaidAmount += clientData.rate * trafficInBytes;
    }

    function setClientRate(string calldata clientId, int newRate) public onlyOwner {
        ClientData storage clientData = clients[clientId];
        clientData.rate = newRate;
    }

    function pay(string calldata clientId) external payable {
        ClientData storage clientData = clients[clientId];

        int amountDeposited = int256(msg.value);

        // assert that full amount is being paid
        require(amountDeposited >= clientData.unpaidAmount, "full amount must be paid");

        // transfer funds to layer8WalletAddress
        (bool success, ) = layer8WalletAddress.call{value: msg.value}("");
        if (!success) {
            revert TransferFailed();
        }

        clientData.unpaidAmount -= amountDeposited;
    }
}

